import React from "react";
import { Route } from "react-router-dom";

class ChoiceSection extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route exact path="" component={Home} />
          <Route exact path="" component={Home} />
          <Route exact path="" component={Home} />
          <Route exact path="" component={Home} />
        </Switch>
      </Router>
    );
  }
}

export default ChoiceSection;
